import os
import numpy as np
from trackit.datasets.SOT.constructor import SingleObjectTrackingDatasetConstructor


def construct_TNL2K(constructor: SingleObjectTrackingDatasetConstructor, seed):
    root_path = seed.root_path
    data_split = seed.data_split
    assert len(data_split) == 1
    data_split = data_split[0]
    sequence_frame_size_mapping = _tnl2k_train_sequence_frame_size if data_split == 'train' else _tnl2k_test_sequence_frame_size

    constructor.set_total_number_of_sequences(len(sequence_frame_size_mapping))
    for sequence_name, sequence_frame_size in sequence_frame_size_mapping.items():
        sequence_path = os.path.join(root_path, sequence_name)
        sequence_bbox_groundtruth = np.loadtxt(os.path.join(sequence_path, 'groundtruth.txt'), delimiter=',')

        nature_language_description_file_path = os.path.join(sequence_path, 'language.txt')
        with open(nature_language_description_file_path, 'r', encoding='utf-8', newline='') as f:
            nature_language_description = f.read().strip()

        sequence_images_path = os.path.join(sequence_path, 'imgs')

        image_files = os.listdir(sequence_images_path)
        image_files = [image_file for image_file in image_files if image_file.endswith(('.jpg', '.png'))]
        image_files.sort()

        assert len(image_files) == len(sequence_bbox_groundtruth)

        with constructor.new_sequence() as sequence_constructor:
            sequence_constructor.set_name(sequence_name)
            sequence_constructor.set_object_attribute('nature language description', nature_language_description)
            for image_file, groundtruth_bounding_box in zip(image_files, sequence_bbox_groundtruth):
                image_file_path = os.path.join(sequence_images_path, image_file)
                with sequence_constructor.new_frame() as frame_constructor:
                    frame_constructor.set_path(image_file_path, sequence_frame_size)
                    frame_constructor.set_bounding_box(groundtruth_bounding_box.tolist())


